import {Container, Nav, NavLink} from "react-bootstrap";
import {Link} from "react-router-dom";

var style = {
    backgroundColor: "#F8F8F8",
    borderTop: "1px solid #E7E7E7",
    textAlign: "center",
    padding: "20px",
    position: "fixed",
    left: "0",
    bottom: "0",
    height: "60px",
    width: "100%",
}

var phantom = {
    display: 'block',
    padding: '20px',
    height: '60px',
    width: '100%',
}

function Footer() {
    return (
        <div>
            <div style={phantom}/>
            <div style={style}>

                <div className="d-flex justify-content-between">
                    <p> &copy; {new Date().getFullYear()} Ismakova</p>
                    <div className="d-inline-flex ml-2">
                        <Link href="https://vk.com/ismakova">Вконтакте</Link>
                        <Link href="https://www.instagram.com/ismaakova/?hl=ru">Instagram</Link>
                    </div>


                </div>
            </div>
        </div>
    )
}

export default Footer;
